import React from 'react';
import logo from './logo.svg';
import './App.css';
import Tree from 'react-tree-graph';

function App() {
  let data = {
    name: 'Parent',
    children: [{
      name: 'Child One'
    }, {
      name: 'Child Two'
    }]
  };

  return (
    <div className="App">
      <Tree
        data={data}
        height={400}
        width={400} />);
    </div>
  );
}

export default App;
